const block2 = (context) => { return html`<${scopeTag("ui5-label", tags, suffix)} id="${ifDefined(context._id)}-label" class="ui5-busy-indicator-text">${ifDefined(context.text)}</${scopeTag("ui5-label", tags, suffix)}>`; };
const block3 = (context) => { return html`<span data-ui5-focus-redirect tabindex="0" @focusin="${context._redirectFocus}"></span>`; };


	return block0(context);
};

export default main;
